import style from './About.module.css'

const About = () => {
    return(
        <div className={style.container}>
            <div className={style.pContainer}>
                <p className={style.pAbout}>
                Soy Cesar, soy desarrollador web Full Stack en stack PERN, Postgres, Express.js, React.js y Node.js,
además poseo conociminetos en Sequelize.js, Redux.js, manejo de Git y GitHub junto con competencias de trabajo con Scram.

Tengo facilidad para el trabajo en equipo y de comunicación, busco siempre un enfoque donde poder trabajar de forma organizada y eficaz con una gran tendencia a optimizar recursos y funcionalidades.
                </p>
            </div>
        </div>
    )
}

export default About;
